<meta charset="utf-8" >

<title>Dots 3</title>
<style>
body {
    background-color: #000;
}
svg {
    background-color: #FFF;
}


#p1, #graph line {
    /*fill: #808080; 
    stroke: #808080;*/
    stroke-width: 1px;
}
#f1 {
    position: absolute;
    top: 5px;
    left: 5px;
}
</style>
<script>
var backgroundColor = "rgb(255, 255, 255)";

function toggleBackgroundColor(id) {
	backgroundColor = document.getElementById(id).style.backgroundColor;
	var newColor;
	if ( backgroundColor != 'rgb(255, 255, 255)' && backgroundColor != "") {
		newColor = 'rgb(255, 255, 255)';
	} else {
		newColor = 'rgb(0, 0, 0)';
	}
	//alert('newColor=' + newColor + ' backgroundColor="' + backgroundColor + '"');
	document.getElementById(id).style.backgroundColor = newColor;
}


</script>
</head>
